package Day03;

public class comparitive_operator {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		double x=10.30;
		double y=20.20;
        System.out.println(a=a);
        System.out.println(a<b);
        System.out.println(a<=a);
        System.out.println(a<b);
        System.out.println(a<=a);
        System.out.println(a>b);
        System.out.println(a!= b);
        System.out.println(x<y);
	}

}
